import "./product.css";
import Pol from "../../img/screenshot.png";
const Product = () => {
  return (
    <div className="p">
      <div className="p-browser">
        <div className="p-circle"></div>
        <div className="p-circle"></div>
        <div className="p-circle"></div>
      </div>
      <a href={Pol} target="_blank" rel="noreferrer">
        <img src={Pol} alt="" className="p-img" />
      </a>
    </div>
  );
};

export default Product;
